import React, { Component } from 'react'
import axios from "axios";


class Property extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: []
    };
  }

  componentDidMount() {
    console.log(this.props);
    axios
      .get("/api/property")
      .then((response) => {
        this.setState({ data: response.data });
      })
      .catch(function (error) {
        console.log(error);
      });
  }
}

export default Property;
